import React, {Component} from 'react';

class AboutMe extends Component {
  render() {
    return (
    <div className="App App-logo App-header App-link">
      <h1 >Alex Corrêa da Silva</h1>
      <p>Sei mexer com React!!</p>
      <h1>Olá Mundo!!!</h1>
    </div>
    );
  };
};

export default AboutMe;
